class Solution {
public:
    class AdjLists {
    private:
        map<int, set<int>> _lists;

        void insert(int left, int right) {
            if (_lists.find(left) != _lists.end()) {
                _lists[left].insert(right);
            } else {
                _lists[left] = set<int>{ right };
            }
        }

        void remove(int left, int right) {
            _lists.erase(left);
            _lists[right].erase(left);

            if (_lists[right].size() == 0 
                // Only remove if this is not the last element! EW, ugly!
                && _lists.size() > 1) {
                _lists.erase(right);
            }
        }
    public:
        void insert(const vector<int>& edge) {
            this->insert(edge[0], edge[1]);
            this->insert(edge[1], edge[0]);
        }

        size_t size() const {
            return _lists.size();
        }

        void removeLeafs() {
            for (auto pair : _lists) {
                if (pair.second.size() == 1) {
                    remove(pair.first, *pair.second.begin());
                }
            }
        }

        vector<int> trees() {
            vector<int> resp;
            for (auto pair : _lists) {
                resp.push_back(pair.first);
            }
            return resp;
        }
    };

    vector<int> findMinHeightTrees(int n, vector<vector<int>>& edges) {
        AdjLists adjLists;

        for (auto edge : edges) {
            adjLists.insert(edge);
        }

        while (adjLists.size() > 2) {
            adjLists.removeLeafs();
        }
        
        return adjLists.trees();
    }
private:
};

string join(string separator, const vector<int> numbers) {
    if (numbers.size() == 0) {
        return "";
    }
    if (numbers.size() == 1) {
        return to_string(numbers[0]);
    }

    return accumulate(next(numbers.begin()), numbers.end(), to_string(numbers[0]), [](string left, int right) { return left + ", " + to_string(right); });
}

